// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EWasteProcessing {
    
    struct Metal {
        string name;
        uint256 contentKgPerTon;
        uint256 recoveryEfficiencyPercent;
        uint256 recoverableAmountKg;
        uint256 marketPriceUsdPerKg;
        uint256 valueUsd;
        uint256 recoveryCostPercent;
        uint256 recoveryCostUsd;
        uint256 netValueUsd;
    }

    struct EWasteBatch {
        string deviceType;
        uint256 amountKg;
    }

    Metal[] public metals;
    EWasteBatch[] public eWasteBatches;

    event MetalAdded(string name, uint256 contentKgPerTon, uint256 marketPriceUsdPerKg);
    event EWasteBatchAdded(string deviceType, uint256 amountKg);
    
    function addMetal(
        string memory _name, 
        uint256 _contentKgPerTon, 
        uint256 _recoveryEfficiencyPercent, 
        uint256 _marketPriceUsdPerKg, 
        uint256 _recoveryCostPercent
    ) public {
        uint256 recoverableAmountKg = (_contentKgPerTon * _recoveryEfficiencyPercent) / 100;
        uint256 valueUsd = recoverableAmountKg * _marketPriceUsdPerKg;
        uint256 recoveryCostUsd = (valueUsd * _recoveryCostPercent) / 100;
        uint256 netValueUsd = valueUsd - recoveryCostUsd;

        metals.push(Metal(_name, _contentKgPerTon, _recoveryEfficiencyPercent, recoverableAmountKg, 
                          _marketPriceUsdPerKg, valueUsd, _recoveryCostPercent, recoveryCostUsd, netValueUsd));
        
        emit MetalAdded(_name, _contentKgPerTon, _marketPriceUsdPerKg);
    }

    function addEWasteBatch(string memory _deviceType, uint256 _amountKg) public {
        require(_amountKg > 0, "Amount must be greater than zero");
        eWasteBatches.push(EWasteBatch(_deviceType, _amountKg));

        emit EWasteBatchAdded(_deviceType, _amountKg);
    }

    function getMetalDetails(uint256 index) public view returns (
        string memory name,
        uint256 contentKgPerTon,
        uint256 recoveryEfficiencyPercent,
        uint256 recoverableAmountKg,
        uint256 marketPriceUsdPerKg,
        uint256 valueUsd,
        uint256 recoveryCostPercent,
        uint256 recoveryCostUsd,
        uint256 netValueUsd,
        string memory processMessage
    ) {
        require(index < metals.length, "Invalid metal index");
        Metal memory metal = metals[index];
        processMessage = string(abi.encodePacked(metal.name, " is allocated to ", metal.name, " recovery process."));
        
        return (
            metal.name,
            metal.contentKgPerTon,
            metal.recoveryEfficiencyPercent,
            metal.recoverableAmountKg,
            metal.marketPriceUsdPerKg,
            metal.valueUsd,
            metal.recoveryCostPercent,
            metal.recoveryCostUsd,
            metal.netValueUsd,
            processMessage
        );
    }

    fallback() external {
        revert("Invalid function call");
    }
}

